USE master
GO
CREATE DATABASE DBG1FOOD
GO
USE DBG1FOOD
GO

CREATE TABLE Account_Status (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE Product_Status (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE Order_Status (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE Comment_Status (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE Voucher_Status (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE [Role] (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE Account (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  email NVARCHAR(255) NOT NULL DEFAULT N'',
  encryptedPassword NVARCHAR(255) NOT NULL DEFAULT N'',
  roleId UNIQUEIDENTIFIER REFERENCES [Role](id),
  statusId UNIQUEIDENTIFIER REFERENCES Account_Status(id)
);

CREATE TABLE [User] (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  addressDetail NVARCHAR(255) NOT NULL DEFAULT N'',
  phone NVARCHAR(255) NOT NULL DEFAULT N'',
  defaultUser BIT,
  accountId UNIQUEIDENTIFIER REFERENCES Account(id),
  statusId UNIQUEIDENTIFIER REFERENCES Account_Status(id)
);

CREATE TABLE Categogy (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE Product (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N'',
  price MONEY NOT NULL,
  salePercent INT,
  image NVARCHAR(MAX),
  statusId UNIQUEIDENTIFIER REFERENCES Product_Status(id),
  categogyId UNIQUEIDENTIFIER REFERENCES Categogy(id)
);

CREATE TABLE Voucher (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  code NVARCHAR(255) NOT NULL,
  quantity FLOAT NOT NULL,
  salePercent INT NOT NULL,
  description NVARCHAR(255),
  statusId UNIQUEIDENTIFIER REFERENCES Voucher_Status(id)
);

CREATE TABLE Shift (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255),
  startTime TIME NOT NULL,
  endTime TIME NOT NULL
);

CREATE TABLE Schedule (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  [date] DATE NOT NULL,
  note NVARCHAR(255),
  shiftId UNIQUEIDENTIFIER REFERENCES Shift(id)
);

CREATE TABLE Schedule_Detail (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  accountId UNIQUEIDENTIFIER REFERENCES Account(id),
  scheduleId UNIQUEIDENTIFIER REFERENCES Schedule(id)
);

CREATE TABLE Cart (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  quantity FLOAT NOT NULL,
  productId UNIQUEIDENTIFIER REFERENCES Product(id),
  accountId UNIQUEIDENTIFIER REFERENCES Account(id)
);

CREATE TABLE [Order] (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  [date] DATETIME NOT NULL,
  note NVARCHAR(255),
  statusId UNIQUEIDENTIFIER REFERENCES Order_Status(id),
  userId UNIQUEIDENTIFIER REFERENCES [User](id),
  scheduleId UNIQUEIDENTIFIER REFERENCES Schedule(id),
  voucherId UNIQUEIDENTIFIER REFERENCES Voucher(id)
);

CREATE TABLE OrderDetail (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  price MONEY NOT NULL,
  salePercent INT,
  quantity FLOAT NOT NULL,
  note NVARCHAR(255),
  productId UNIQUEIDENTIFIER REFERENCES Product(id),
  orderId UNIQUEIDENTIFIER REFERENCES [Order](id)
);

CREATE TABLE Unit (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL,
  description NVARCHAR(255)
);

CREATE TABLE Categogy_Warehouse_Item (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL DEFAULT N'no name',
  description NVARCHAR(255) DEFAULT N''
);

CREATE TABLE Warehouse_Item (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255) NOT NULL,
  description NVARCHAR(255),
  CategogyItemId UNIQUEIDENTIFIER REFERENCES Categogy_Warehouse_Item(id),
  unitId UNIQUEIDENTIFIER REFERENCES Unit(id)
);

CREATE TABLE Recipe (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  quantity FLOAT NOT NULL,
  productId UNIQUEIDENTIFIER REFERENCES Product(id),
  warehouseItemId UNIQUEIDENTIFIER REFERENCES Warehouse_Item(id)
);

CREATE TABLE Warehouse (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  name NVARCHAR(255),
  quantity FLOAT,
  warehouseItemId UNIQUEIDENTIFIER REFERENCES Warehouse_Item(id)
);

CREATE TABLE Warehouse_Import (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  [date] DATETIME NOT NULL,
  quantity FLOAT NOT NULL,
  price MONEY NOT NULL,
  warehouseId UNIQUEIDENTIFIER REFERENCES Warehouse(id),
  accountId UNIQUEIDENTIFIER REFERENCES Account(id)
);

CREATE TABLE Warehouse_Export (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  quantity FLOAT NOT NULL,
  [date] DATETIME NOT NULL,
  scheduleId UNIQUEIDENTIFIER REFERENCES Schedule(id),
  warehouseId UNIQUEIDENTIFIER REFERENCES Warehouse(id)
);

CREATE TABLE Menu (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  quantity FLOAT NOT NULL,
  scheduleId UNIQUEIDENTIFIER REFERENCES Schedule(id),
  productId UNIQUEIDENTIFIER REFERENCES Product(id)
);

CREATE TABLE Destruction (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  quantity FLOAT NOT NULL,
  image NVARCHAR(MAX),
  accountId UNIQUEIDENTIFIER REFERENCES Account(id),
  scheduleId UNIQUEIDENTIFIER REFERENCES Schedule(id),
  warehouseExportId UNIQUEIDENTIFIER REFERENCES Warehouse_Export(id)
);

CREATE TABLE Comment (
  id UNIQUEIDENTIFIER PRIMARY KEY NOT NULL,
  content NVARCHAR(MAX),
  statusId UNIQUEIDENTIFIER REFERENCES Comment_Status(id),
  accountId UNIQUEIDENTIFIER REFERENCES Account(id),
  productId UNIQUEIDENTIFIER REFERENCES Product(id),
  parentCommentId UNIQUEIDENTIFIER DEFAULT NULL
);


	















